import Premade from "../storage/premade";

const SpmLek =  {

    getPremadeGame(id) {
        // Get JSON data from premade.json
        // Where id = id from parameter
        // return the questions as an array
        let game = Premade.filter(game => game.id === id);
        return game[0].questions;
    },
};



export default SpmLek;
